import { NextRequest, NextResponse } from 'next/server';

const BACKEND_URL = process.env.BACKEND_URL || 'http://localhost:8080';

// POST /api/wallets/users/[userId]/charge - 지갑 충전
export async function POST(
    request: NextRequest,
    { params }: { params: { userId: string } }
) {
    try {
        const { userId } = params;
        const body = await request.json();

        const response = await fetch(`${BACKEND_URL}/api/wallets/users/${userId}/charge`, {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(body),
        });

        if (!response.ok) {
            const errorData = await response.json().catch(() => ({
                status: response.status,
                code: `${response.status}-ERROR`,
                message: response.statusText || '서버 오류가 발생했습니다.'
            }));

            return NextResponse.json(errorData, { status: response.status });
        }

        const data = await response.json();
        return NextResponse.json(data);
    } catch (error) {
        console.error('지갑 충전 에러:', error);
        return NextResponse.json(
            {
                status: 500,
                code: 'INTERNAL_SERVER_ERROR',
                message: '서버 내부 오류가 발생했습니다.'
            },
            { status: 500 }
        );
    }
}

